import React from "react";

class MainVideo extends React.Component {
  render() {
    if (!this.props.video) {
      return "Select a video";
    } else {
      return (
        <div>
        "Video selected is " + this.props.video.snippet.title
        </div>
        );
    }
  }
}

export default MainVideo;
